import PageNotFound from './pages/404';
import SignInEmail from './pages/SignIn/Email';
import SignInPassword from './pages/SignIn/Password';
import SignUp from './pages/SignUp';
import Account from './pages/MyAccount/Home';
import Search from './pages/Search';
import Birthday from './pages/MyAccount/Birthday';
import Email from './pages/MyAccount/Email';
import Password from './pages/MyAccount/Password';
import Gender from './pages/MyAccount/Gender';
import PersonalInfo from './pages/MyAccount/PersonalInfo';
import DataPrivacy from './pages/MyAccount/DataPrivacy';
import DeleteAccount from './pages/MyAccount/DeleteAccount';
import Name from './pages/MyAccount/Name';
import UserContextProvider from './usercontext';
import { darkTheme, lightTheme, GlobalStyles, ThemeProvider, useTheme } from './themes';
import { BrowserRouter as Router, Route, Routes, Navigate, Outlet } from 'react-router-dom';
import { Helmet } from 'react-helmet';

export default function App() {
  const [theme] = useTheme();

  const PrivateRoute = ({ children}) => {
    let user = JSON.parse(localStorage.getItem('user'));
    if (user !== null) {
      return children
    }
    return <Navigate to="/signin/identifier/" />
  }

  const ProtectedRoute = ({ redirectPath = '/signin/identifier' }) => {
    let user = JSON.parse(localStorage.getItem('user'));
    if (user !== null) {
      return <Navigate to="/signin/identifier/" />
    }
    return <Outlet />
  }
  return (
    <>
    <Helmet>
      <title>Google</title>
    </Helmet>
    <ThemeProvider theme={theme === 'light' ? lightTheme : darkTheme}>
    <GlobalStyles />
    <UserContextProvider>
      <Router>
        <Routes>
          <Route exact path="/" element={<Search />}/>
          <Route path="/signin/identifier/" element={<SignInEmail />} />
          <Route path="/signin/challenge/" element={<SignInPassword />} />
          <Route path="/signup/" element={<SignUp />} />
          <Route path="*" element={<PageNotFound />} />
          <Route element={<ProtectedRoute />}>
            <Route path="/myaccount/" element={<Account />} />
          </Route>
          <Route path="/myaccount/personalinfo/"
            element={
              <PrivateRoute>
                <PersonalInfo />
              </PrivateRoute>
            }
          />
          <Route path="/myaccount/data-and-personalization/"
            element={
              <PrivateRoute>
                <DataPrivacy />
              </PrivateRoute>
            }
          />
          <Route path="/myaccount/deleteaccount/"
            element={
              <PrivateRoute>
                <DeleteAccount />
              </PrivateRoute>
            }
          />
          <Route path="/myaccount/name/"
            element={
              <PrivateRoute>
                <Name />
              </PrivateRoute>
            }
          />
          <Route path="/myaccount/birthday/"
            element={
              <PrivateRoute>
                <Birthday />
              </PrivateRoute>
            }
          />
          <Route path="/myaccount/gender/"
            element={
              <PrivateRoute>
                <Gender />
              </PrivateRoute>
            }
          />
          <Route path="/myaccount/email/"
            element={
              <PrivateRoute>
                <Email />
              </PrivateRoute>
            }
          />
          <Route path="/myaccount/password/"
            element={
              <PrivateRoute>
                <Password />
              </PrivateRoute>
            }
          />
        </Routes>
      </Router>
      </UserContextProvider>

    </ThemeProvider>
    </>
  )
}
